import React from 'react'

export default class UserHome extends React.Component{

    render(){
        return(
            <div className="ui raised very padded text container segment form">
                <h1>{this.props.user.username}</h1>
                <div className='ui borderless red inverted menu'>
                    <div className='item'>
                        <div className='ui massive yellow button'>Create a game</div>
                    </div>
                    <div className='item'>
                        <div className='ui massive green button'>Join a game</div>
                    </div>
                </div>
            </div>
        )
    }
}
